$('document').ready(function(){
    if ( $('.menuZone') && $('.menuZone').offset() ){
        var top = $('.menuZone').offset()['top'];
        if (typeof top === 'undefined') top = 120;
        top += 8;
        $('.menuZone').affix({
              offset: {top: top}
        })
    }
})

